// Credit: https://craftpix.net/freebies/free-game-icons-fantasy-mage-outfit-pack-7/
import SkullRobesImg from './skull-robes.png';

const SkullRobes = {
  name: 'Skull Robes',
  type: 'armor::body',
  effect: {
    mana: 90,
  },
  image: SkullRobesImg,
  value: 125,
};

export default SkullRobes;
